(function execute(inputs, outputs) {

    var langs = [];

        langs.push({
            "label": "Kazakh",// "kk",
            "name":  "kk"
        });

   langs.push({
            "label": "Icelandic",// "is"
            "name": "is"
        });
   langs.push({
            "label":"Marathi",//mr
            "name": "mr"
        });
  langs.push({
            "label": "Latvian",//lv
            "name": "lv"
        });
  langs.push({
            "label": "Swahili",//sw
            "name": "sw"
        });

    outputs.langs = {
        data: langs
    }
})(inputs, outputs);

